INSERT INTO `items` VALUES (1,1,1,'Portada','Libro de música de vihuela de mano intitulado El maestro. El qual trahe el mesmo estilo y orden que vn maestro trahería con un discípulo principiante: mostrándole ordenadamente desde los principios toda cosa que podría ignorar para entender la presente obra. Compuesto por don Luys Milán. Dirigido al muy alto y muy poderoso e inuictíssimo principe don Juhan: por la gracia de Dios rey de Portugal y de las yslas. Año M.D.xxxv. Con privilegio Real.',0,0),(1,2,1,'fol. 2v. Grabado: Inuictissimus Rex Lusitanorum','',0,0),(1,3,1,'fol. 3. Prólogo','',0,0),(1,4,1,'fol. 3. Dedicatoria','',0,0),(1,5,1,'fol. 3v. Declaración del libro','',0,0),(1,6,1,'fol. 6v. Grabado: Orfeo tañendo la vihuela','',0,0),(1,7,1,'fol. B1. Avisos  al lector','',0,0),(1,8,1,'','',0,1),(1,9,1,'PRIMER LIBRO','',0,1),(1,10,1,'VIHUELA SOLA','',0,1),(1,11,1,'#B1v#Fantasía del primero tono','El título en fol. B1r.',1,1),(1,12,1,'#B2v#Fantasía del primero tono','',1,1),(1,13,1,'#B3v#Fantasía del primero tono','',1,1),(1,14,1,'#B5#Fantasía del segundo tono','',1,1),(1,15,1,'#B6#Fantasía del segundo tono','',1,1),(1,16,1,'#C1v#Fantasía de tono mixto, primero y segundo','',1,1),(1,17,1,'#C3#Fantasía del tercero tono','',1,1),(1,18,1,'#C4v#Fantasía del quarto tono','Falta el título de la fantasía, que aparece en la Corrección del Auctor en los herrores de la Emprenta, fol. R6v. En el ejemplar R. 9281 de la Biblioteca Nacional de Madrid hay una nota manuscrita, con grafía más moderna, que reproduce en el fol. C4v la corrección.',1,1),(1,19,1,'#C5v#Fantasía de tono mixto, tercero y quarto','',1,1),(1,20,1,'','',0,1),(1,21,1,'#D3v#Fantasía del primero y segundo tono','Hay un error en la numeración de los fols. del cuaderno de la D, que afecta a los nos 10 a 14; el orden correcto sería: D3, D2, D1, D6, D5, D4. En el ejemplar R. 14752 el orden es incorrecto, pues se ha respetado la numeración correlativa de los folios; no así en el R. 9281, que está encuadernado en el orde