alenciano del siglo XVI”, Nueva Revista de Filología Hispánica, xl/1 (1992) 187-198, esp. p. 189, nota 7. También aparece, con música distinta a la de Fuenllana, en la Recopilación de Sonetos y Villancicos a quatro y a cinco de Juan Vásquez (Sevilla, 1560). Cf. la ed. de Higinio Anglés, Barcelona: CSIC, 1946, nº 8, pp. 36 y 137–140. Sin embargo, en alguna otra reimpresión de Orphénica Lyra de la cual no se conservan ejemplares en ninguna biblioteca de Madrid se añadiría ese primer verso, sin música, al principio de la composición; así aparece, de hecho, en la edición facsimilar de Ginebra, Minkoff Reprint, 1981.',2,5),(6,297,6,'#145#De Antequera sale el moro, romance viejo a quatro de Morales','',2,5),(6,298,6,'#145#A las armas moriscote, romance viejo a quatro de Bernal','',2,5),(6,299,6,'','',0,5),(6,300,6,'fol. 145v. Portadilla del Libro sexto','Accipe diuinam, quae venit ab aethere, musam. Libro sexto, en el qual se ponen ensaladas, música compuesta y fantasías, para vihuela de cinco órdenes. Assí mismo música compuesta y fantasías para guitarra. También se ponen algunas fantasías y pedaços de contrapunto, para vihuela de seys, con ocho tientos para los ochos tonos: con los quales acaba el presente libro. Hac poteris curas attenuare Lyra.',0,6),(6,301,6,'','',0,6),(6,302,6,'LIBRO SEXTO','',0,6),(6,303,6,'VOZ (EN CIFRA; ALGUNOS COMPASES EN NOTACIÓN MENSURAL) Y VIHUELA','',0,6),(6,304,6,'#146#Iubilate Deo. Ensalada de Flecha. D','',5,6),(6,305,6,'#146v#Para mí me lo querría','',5,6),(6,306,6,'#146v#Poltron fransoi','',5,6),(6,307,6,'#147#¡Que sí puede ser, señor bachiller!','',5,6),(6,308,6,'#147v#Mejor le fuera mal año','',5,6),(6,309,6,'#147v#En la ciudad de la Gloria','',5,6),(6,310,6,'#148#El vanastón me espanta','',5,6),(6,311,6,'#148#Nan [non] far el cauaglier','',5,6),(6,312,6,'#148v#A la girigonça','',5,6),(6,313,6,'#149#Et ipsa conteret caput tuum','',5,6),(6,314,6,'#149#Bomba, bomba. Ensalada de Flecha. D','',5,6),(6,315,6,'#149v#¡A l’escota socorred!','