,62,7,'#80v#Segunda parte, Yo no nascí sino para quereros','',2,3),(7,63,7,'#81v#¡Quán bienaventurado! Cancion a quatro','',2,3),(7,64,7,'#83#Prado verde y florido. Villanesca a quatro de Francisco Guerrero','',2,3),(7,65,7,'#84#Pues ya las claras fuentes. Villanesca a quatro de Zaballos','',2,3),(7,66,7,'#85v#¡Ay de mí, sin ventura! Villanesca a quatro de Nabarro','',2,3),(7,67,7,'#87v#¡Adiós, verde ribera y pradería! Villanesca a quatro de Guerrero','',2,3),(7,68,7,'#89#¿No vez [sic], Amor, que esta gentil moçuela?  Villanesca a quatro de. Nabarro','En la Tabla final, fol. 113v, No vees amor',2,3),(7,69,7,'#90v#Esclareçida Iuana, el que se atreue. Villanesca a quatro de Villalar','',2,3),(7,70,7,'#91v#Duro mal, terrible llanto. Villanesca a quatro de Caballos','',2,3),(7,71,7,'#93#Dime, manso viento. Villanesca a quatro de Caballos','',2,3),(7,72,7,'#94#Cállese ya Mercurio. Villanesca a quatro','',2,3),(7,73,7,'#95v#Nunca más verán mis ojos. Villancico a tres, fácil','',2,3),(7,74,7,'#96#Buelta, Pues que mis ojos perdieron','',2,3),(7,75,7,'#96v#Dame acogida en tu hato. Villancico viejo a tres, fácil','',2,3),(7,76,7,'#97#Buelta, Esta noche en tu cabaña','',2,3),(7,77,7,'#97#A tierras agenas. Villancico a tres [fácil]','',2,3),(7,78,7,'#99#¿Qué razón podéys vos tener? Villancico a quatro de Nabarro','',2,3),(7,79,7,'#99v#Buelta, Con razón podéys dezir','',2,3),(7,80,7,'#100v#Alegrías, alegrías. Villancico a quatro','',2,3),(7,81,7,'#101v#Buelta, Canta, Gil, vna canción','',2,3),(7,82,7,'#102v#Gritos daua la morenica. Villancico a quatro','',2,3),(7,83,7,'#103v#Serrana, ¿dónde dormistis? Villancico a quatro','',2,3),(7,84,7,'#104v#A ser con vuestro marido','',2,3),(7,85,7,'#104v#Zagaleja, la de lo verde. Villancico a quatro','',2,3),(7,86,7,'#105v#Buelta, Yo me voy con mi ganado','',2,3),(7,87,7,'#107v#¿Quién te hizo, Juan pastor? Villancico a quatro','',2,3),(7,88,7,'#108#Buelta, Solías con tus cantares','',2,3),(7,89,7,'#108v#Quando las desdichas mías. Villancico a quatro','',2,3),(7,90,7,'#109#Buelta, Si ventura, de piadosa','',2,3),(7,91,7,'#109v#Mira, Iuan, lo que te dixe. Villancico a quatro','',2,3),(7,92,7,'','',0,3),(7,93,7,'VIHUELA SOLA','',0,3),(7,94,7,'#110#Vostre rigueur. Canción Francesa de Crecquillon, a tres, tañida sin cantar','',1,3),(7,95,7,'#112#Ie prens en gre. Cancion Francessa a quatro, tañida sin cantar','',1,3),(7,96,7,'','',0,3),(7,97,7,'fol. 113 bisv Tabla de lo que se contiene en este libro','Hay dos folios numerados como 113, numerados aquí como 113 y 113 bis.',0,3),(7,98,7,'','',0,4),(7,99,7,'Colofón','Fue impresso el presente Libro hecho por Esteuan Daça en la muy Noble villa de Valladolid por Diego Fernández de Córdoua, Impressor de su Magestad, acabose a doze días del mes de Abril año de mil y quinientos y setenta y seys.',0,4),(8,1,8,'#263v#Fantasia','Es la obra más larga y la más afectada por el guillotinado, ocasionando 24 lagunas en sus 240 compases.',1,NULL),(8,2,0,'#267#Final de cualquier cosa o Tiento de vigüela','Tiento de características similares a los de Alonso Mudarra.',1,NULL),(8,3,NULL,'',' ',0,NULL),(8,4,NULL,'#267v#La vella mal marida','Es una versión con el texto cambiado \"a lo divino\" de un conocido texto que ya fue utilizado en el Cancionero de Palacio en una obra compuesta por Gabriel (Nº 234), así como por los vihuelistas Luis de Narváez en Los seys libros del Delphin (Nº 28) y Enríquez de Valderrábano en su libro Silva de Sirenas (Nº 50)',0,NULL),(8,5,NULL,'#268v#Glosa de Padilla sobre el bien dubdoso','El texto se debe a fray Pedro de Padilla',0,NULL),(8,6,NULL,'#269#Glosa sobre a su albedrío','Aparece como una obra anónima a 3v en el Cancionero de Medinaceli (Nº 41)',0,NULL),(8,7,NULL,'','',0,NULL),(8,8,0,'#270#Diferencias sobre la Pavanilla','Originalmente había 6 diferencias, pero la primera de ellas, en el f. 269, se perdió por el guillotinado. La quinta diferencia aparece repetida en el f. 282 en medio del Pange Lingua.',1,NULL),(8,9,0,'#272#Cuatro differencias de folias','Diferencias basadas en el famoso tema de la Folie d\'Espagne. Presentan algunas afinidades constructivas con las Diferencias sobre la Pavanilla que la preceden, por lo que posiblemente estén compuestas por el mismo autor.',1,NULL),(8,10,9,'#273v#Seis diferencias de bacas (I)','Otros autores como Luis de Narváez, Diego Pisador, Alonso Mudarra, Antonio de Cabezón y Luis Venegas de Henestrosa también escribieron obras basadas en el mismo tema de las vacas.',1,NULL),(8,11,10,'#275#Diez diferencias de folias','Presentan un mejor tratamiento polifónico que las otras folías anónimas.',1,NULL),(8,12,2,'#278#Tres diferencias de bacas','Son las mismas diferencias sobre Guardame las vacas que aparecen en el libro VI de Los seys libros del Delphin con algunas pocas variantes y errores del copista.',1,NULL),(8,13,9,'#278v#Seis diferencias de bacas (II)','',1,NULL),(8,14,11,'#280v#Fantasia','Francesco da Milano emplea el mismo tema en sus obras para laúd, Fantasía XXV y Ricercara LI.',1,NULL),(8,15,0,'#281#Pange lingua sobre el contrabaxo','Basada en el himno Pange lingua tradicional español.',1,NULL);
